        # 当前用户是否能访问此授权
        self.can_access = can_access
        # 创建时间
        self.created_at = created_at
        # 创建者的UserID
        self.creator = creator
        # 是否禁用子团队继承
        self.disinherit_sub_group = disinherit_sub_group
        # domain_id
        self.domain_id = domain_id
        # 被授权的driveID
        self.drive_id = drive_id
        # 过期时间
