        if m.get('support_ext') is not None:
            self.support_ext = m.get('support_ext')
        self.template = []
        if m.get('template') is not None:
            for k in m.get('template'):
                temp_model = VideoPreviewVideoTemplate()
                self.template.append(temp_model.from_map(k))
        return self


